INSERT INTO `review` VALUES (29,'94fb30e5-9f41-4f42-b1f9-acd637440420.jpg','너무 멋진 사진을 찍어주셔서 감사해요~ 다음에 또 예약하고 싶어요 행복한 순간이었습니다!','2023-02-11 16:58:05','사진 순간 ',8,33,1,34),(31,'9a412c8d-451b-4721-b75e-ba2bc3da13bd.jpg','\"정말 기억에 남을만한 인생샷 남겨주셨어요\\n다음에 또 예쁜 사진 부탁드립니다\\n사진 찍을 때 친절하게 대해주셔서 감사해요:)\"','2023-02-13 09:14:00','인생샷 사진 사진 기억 ',3.9008265,34,14,39),(32,'69428a97-1a3f-446d-8e2d-476073b47b41.jpg','\"친구와 좋은 추억 만들었어요\\n시크하지만 저희의 부탁 다 드려주시는 츤데레 작가님\\n감사합니다\"','2023-02-13 09:15:23','츤데레 작가님 감사합니다 추억 부탁 친구 ',3.7933884,47,13,39),(33,'6b164975-e504-448c-b231-b67e40d10a84.jpg','\"귀여운 우리 아기 사진 정말 귀엽게 찍어주셨어요 다음에 아이가 크면 또 찍고 싶어요\"','2023-02-13 09:17:36','사진 아기 아이 ',4.9917355,19,15,5),(34,'66ead047-4227-4242-8ba0-db1ddf5991db.jpg','\"사진를 정말 잘 찍어주시네요. 이렇게 이쁜 잠자리는 처음 봐요. 다음에 또 찍어주셨으면 좋겠어요\"','2023-02-13 15:20:31','사진 다음 잠자리 ',4.9917355,53,18,5),(37,'68ab258c-e9bb-48f7-8a49-3e0c8d4ac39e.jpg','\"귀여운 울 애옹이 더 귀엽게 찍어주셨어요\\u003e\\u003c\\n작가님 완전 금손입니다 동물 사진 맛집입니다\"','2023-02-15 09:54:40','완전 금손 동물 사진 작가님 맛집 울 애옹 ',4.59322,50,12,45),(38,'d5e417dd-9d4b-4033-a848-b9defba87b68.jpg','\"원하는 느낌으로 잘 찍어주셨어요\\n조만간 프로필 사진 또 찍어야할 일 있을텐데 또 뵙고 싶네요\"','2023-02-15 09:55:49','프로필 사진 느낌 ',4.958678,50,11,45),(39,'a2e2ee4c-8f94-4663-ba6d-c1f76b1cb45f.jpg','\"진짜 화보 같아요! 만족합니다!!!\"','2023-02-16 15:32:36','화보 ',4.789855,32,32,99),(40,'ba849d56-218b-44bb-9b6f-e336ddc4cbc4.jpg','\"느낌 있게 잘 찍어주셨어요\\n오랜만에 프로필 사진 바꿨어요 감사합니다\"','2023-02-16 15:36:54','프로필 사진 느낌 ',3.4745762,71,33,42),(41,'742163a1-77e2-448f-9734-6c3b9f2fe4a2.jpg','\"너무 별로였어요\\n불친절하고 이런 것도 사진이라고 찍어주시는지\\n진짜 다시는 예약할 생각 없네요\\n제가 진상이 아니고 작가님이 너무 별로에요\"','2023-02-16 15:38:00','진상 생각 작가님 사진 ',1.0495868,34,34,19),(42,'8a1549dd-0f82-4152-9048-67c524f3f3ce.jpg','\"완전 맘에 들어요!!\"','2023-02-16 15:48:31','완전 맘 ',4.884058,32,36,17),(43,'89d54be6-efba-42da-9d67-48bc7839e44e.jpg','\"심령사진같이 나와서 좋아요\"','2023-02-16 15:51:54','심령사진 ',3.892562,71,37,19),(44,'ec9d6c4d-90a8-48d5-bd74-cf1a7641d06e.jpg','\"맹구 작가님 정말 친절하세요 감사합니다 사진도 잘나왔어요\"','2023-02-16 15:58:21','맹구 작가님 사진 ',2.9338844,35,38,19),(45,'2f25e74e-98f1-4203-92d5-7e8ccf066fb8.jpg','\"친절하세요\\n잘생겼어요\\n합리적인 가격에 좋은 퀄리티에요\\n다음에 또 찍고 싶어요\"','2023-02-16 23:52:46','다음 가격 합리 퀄리티 ',4.9421487,35,42,9),(46,'fb7f0d85-d485-42c3-9385-5757a5c35b54.jpg','\"상냥해요\\n합리적인 가격이에요\\n사진 퀄리티는 다소 아쉬워요\\n다음엔 다른 작가님을 찾아볼래요\"','2023-02-16 23:53:41','사진 퀄리티 합리 작가님 가격 ',4.9669423,103,44,9),(47,'df3399d8-0dd8-4746-aced-62ca3d86fd71.jpg','\"진짜 지윤작가님은 최고입니다. 금손 그자체.. 떼돈버세요.. 제발..\"','2023-02-16 23:57:45','최고 지윤작가님 ',3.8188405,103,43,38),(48,'4dc2ccae-bbe0-4c19-9ecd-8e7940d8c881.jpg','\"지윤 작가님의 손맛.. 잊지 못하고 또 와버렸습니다.\\n하 이제 다른 분한텐 못찍겠어요.. 길들어져 벌임...\"','2023-02-17 00:00:56','지윤 작가님 손맛 ',4.7971015,103,45,38),(49,'d211feb3-3941-450e-965b-fc0049cb2e07.jpg','\"장원영 작가님한테는 다시는 안찍을래요.\\n저는 본인이 아닙니다. 막찍는다고 잘나오지 않아요.\\n본인은 기본 카메라로 찍든 옆구르기하면서 찍든\\n발가락으로 찍든 이쁘겠지만 전 아니라구요!!!!\\n\\n장원영 작가님은 본인 셀카만 찍길.. 거의 여자 덱스..\"','2023-02-17 00:04:19','장원영 여자 덱스 작가님 작가님 기본 카메라 발가락 본인 셀카 ',2.4518518,32,46,38),(50,'b0c93ab3-9971-40e9-a52a-5c1c2151e8fa.jpg','\"사진 진짜 잘찍어주시고 무엇보다 보정 실력 미쳐벌임.\\n근데 살짝 아쉬운 건 사진 보정이 너무 오래걸려서 일주일 뒤에나 사진 받을 수 있는 점 정도..?\\n\"','2023-02-17 00:05:39','사진 보정 보정 사진 실력 사진 ',4.072464,71,47,38),(51,'7dd760b7-3b84-4022-a0f0-d20d2da66fe1.jpg','\"지윤 작가님 리뷰 별점 5점 제대로들 주신 거 맞나요..?\\n시간 약속도 1시간이나 늦으시고, 보정도 너무 느리신데..?\\n물론 퀄리티는 괜찮긴 한데 저는 다시는 안할 거 같네요.\"','2023-02-17 00:11:56','지윤 작가님 리뷰 별점 퀄리티 약속 5 1 ',2.826087,103,48,16),(52,'4829761b-39e6-4004-90ae-4ea4baef7582.jpg','\"장원영 작가님 진짜 너무 최고에요..!\\n세심하게 하나하나 다 물어봐주시고 저같은 소심이들은 딱 믿고 맡기기 최고인 작가님입니다.\\n\\nINFJ들 모두 모여라\"','2023-02-17 00:13:27','장원영 INFJ들 모두 모여라 작가님 최고인 작가님 소심이들 ',4.7753625,32,49,16),(53,'31fda3b9-0601-4040-b2c4-23017dd1b74c.jpg','\"이름처럼 사진을 한아름 안겨주셨어요\\n감사합니다\\n다음에 또 봐요\"','2023-02-17 00:19:57','사진 다음 이름 ',4.041322,36,50,38),(54,'115685c0-7b2a-4313-b3d1-7395f4bae9cc.jpg','\"재민 작가님 믿고 찍으세요.\\n사진 퀄리티부터 보정까지 거를게 없습니다.\"','2023-02-17 00:20:02','재민 작가님 퀄리티 보정 사진 ',4.325926,113,51,38),(55,'7d49549f-5629-4a28-aa1d-014f78acfd21.jpg','\"아니 이딴게 사진?\\n나도 그럼 사진 찍겠다 ^_^\\n이거 신고 기능없나요..? 앱쓰레기네요^^*\"','2023-02-17 00:21:43','사진 사진 신고 기능 ',1.5797101,110,52,38);
